import React from 'react';
import Menu from './Menu';
import './Facilities.css';

const Facilities = () => {
  return (
    <div className="facilities-container">
      <Menu />
      <div className="content">
        <h1>Facilities</h1>
      </div>
    </div>
  );
};

export default Facilities;
